Strike Back is een verhaal van bedrog, verlossing en wraak. 
Dit alles speelt zich af in de aaneengeschakelde levens van twee voormalige soldaten: 
Major Hugh Collinson en John Porter.
Hun pad heeft elkaar zeven jaar geleden voor het laatst gekruist. 
Nu, temidden van een nieuwe crisis in het Midden Oosten, 
staan hun levens op het punt elkaar weer te kruisen.
Er wordt gefilmd in en rond Johannesburg, Zuid-Afrika. 


The actions of 'Section 20', a secretive unit of British military intelligence. 
A team of special operations personnel conduct several high risk missions throughout the globe. 


